INSERT INTO `gh_addons` (`id`, `cat`, `name`, `info`, `dir`, `install`) VALUES
(14, 2, 'Anti Fullupdate Spam 2.0 Fixed', 'Простенький плагин определяющий спам командой Fullupdate.', 'cstrike/', 48),
(10, 10, 'Snow Man v2', 'Снеговики для Новогодних серверов! Команда админа: man_spawn', 'cstrike/', 17),
(15, 2, 'Anti AutoBuy Bug', 'Плагин защищает от эксплойта для краша сервера', 'cstrike/', 62),
(16, 2, 'Admin Spect ESP [наблюдение за игроками]', 'WH для админов, чтоб определить WH у игрока', 'cstrike/', 87),
(17, 2, 'Peeping Tom', 'Плагин помогает админам обнаружить игроков использующих чит WallHack. <br>peepingTom_team (показывать тиммейтов или нет, default 1<br>\r\npeepingTom_alive плагин работает даже если вы живой, default 0', 'cstrike/', 18),
(18, 2, 'Block Wallhack V10 ', 'Этот плагин блокирует Wallhack ', 'cstrike/', 88),
(20, 2, 'HackDetector Lite', 'Модуль и плагин для детекта и блокировки спидхака.', 'cstrike/addons/', 55),
(23, 3, 'Prokreedz', 'Плагин делает из вашего сервера jump сервер.\r\n', 'cstrike/', 8),
(22, 3, 'Hide N Seek', 'Данный мод напоменает всемируную игру ЛОВ,суть игры в том что CT должен догнать TER у которого при себе 2 флешки и однин Smoke,который в свою очередь заморажует CT,хотя у CT в арсенали убийственное оружея ето Knife', 'cstrike/', 11),
(25, 3, 'SURF MOD - uSurf', 'Плагин управления сервером Surf работает только на картах surf', 'cstrike/', 11),
(26, 3, 'X-War 1.5', 'Мод предназначен для проведения Clan War в Counter Strike', 'cstrike/', 8),
(27, 3, 'War3FT', 'Новая официальная версия мода warcraft3FT', 'cstrike/', 9),
(29, 3, 'Deathrun', 'Deathrun мод', 'cstrike/', 32),
(24, 3, 'Zombie Plague Mod  5.0.8', 'Добавляет на ваш сервер Zombie mod', 'cstrike/', 25),
(41, 7, 'Info Rank Rus', '<p><img alt="" src="http://info-game-soft.at.ua/_fr/0/4165417.jpg" style="float:left; height:103px; margin:5px 15px; width:275px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Плагин показывает ваш ранк в чате</p>', 'cstrike/', 57),
(33, 3, 'Gungame v2.13 Beta 4', 'Своеобразная модификация классического режима deathmatch, но в отличии от него, игроку не даётся право выбрать оружие.', 'cstrike/', 4),
(35, 9, 'Register System', '<p><span style="color:#FFF0F5;">Система регистрации для вашего сервера. Каждый пользователь получит возможность установить на свой ник пароль и если кто-то попытается зайти под зарегистрированным ником, не авторизировавшись, то будет кикнут с надписью о том что он не залогинен.</span></p>\n\n<p><span style="color:#FFF0F5;">При первом запуске плагина автоматически создастся файл - regusers.ini. В нем хранятся все пароли, а для большей безопасности они еще и зашифрованы ...</span></p>\n', 'cstrike/', 12),
(37, 8, 'SnowBalls v1.2 (снежки вместо гранат)', 'лагин SnowBalls меняет модели гранат на снежки. В кварах имеется возможность установки следа за летящей гранатой и свечения вокруг гранаты.', 'cstrike/', 25),
(40, 7, 'Advanced Experience System (Армейские звания)', 'Универсальный плагин опыта и званий. За определенные действия игроки получают опыт и повышаются по званию. Включает в себя систему поощрений игроков в виде бонусов за звания. Всё полностью настраивается как вам нужно. <br> Расположение информера меняется в конфиге.', 'cstrike/addons/amxmodx/', 84),
(42, 7, 'Surf Olympics', 'Статистика для Surf Mod + основные Surf функции', 'cstrike/', 3),
(43, 7, 'Damager', 'Плагин damager показывает сколько hp вы (или вам) отняли.', 'cstrike/', 60),
(44, 7, 'StatsX Shell (Ultimate StatsX)', 'Это усовершенствованный плагин статистики, выполненный на основе оригинального StatsX <br> Обязательно закомментируйте StatsX в plugins.ini иначе статистика будет работать не корректно.', 'cstrike/', 29),
(45, 7, 'Killa_HP(RUS)', '<p><img alt="" src="http://kz-balkashin.ucoz.kz/kartinki_plu/hp_AND_ap.jpg" style="float:left; height:149px; margin:10px 25px; width:250px" /></p>\r\n\r\n<p>В чате показывается сколько осталось HP и AP у человека, который вас убил.</p>', 'cstrike/', 49),
(46, 7, 'Showtime RUS', '<p><img alt="" src="http://z0na55.my1.ru/_ld/1/89587929.jpg" style="float:left; height:100px; margin:5px 15px; width:240px" /></p>\n\n<p>Показывает справа в верху зелеными буквами название сервер, время, сколько до следущей карты, название следущей карты.</p>\n', 'cstrike/', 15),
(52, 7, 'kz_ljs_xm', 'Статистика прыжков', 'cstrike/', 4),
(53, 7, 'Reset Score', 'С помощью данного плагина игроки могут сбросить очки', 'cstrike/', 73),
(54, 7, 'uq_jumpstats', 'Статистика для HNS мода. \r\nДля вызова меню - say /ljsmenu', 'cstrike/', 2),
(55, 4, 'Weapon Menu RUS', 'Меню Оружия. Позволяет админам давать или получать оружие через меню.', 'cstrike/', 72),
(56, 4, 'amx_admin_announce', 'Плагин анонсирует подключение админа к серверу', 'cstrike/', 45),
(57, 4, 'Show Admins', 'Плагин показывает админов, которые сейчас на сервере', 'cstrike/', 60),
(58, 4, 'Admin Cheat Menu', 'Плагин делает админу читерское меню, в которое собрано огромное количество разных команд. Команда админа adminmenu', 'cstrike/', 59),
(59, 4, 'SayRestart', 'Плагин позволяет админу написать в чате /restart и произойдёт рестарт через 1 секунду.', 'cstrike/', 21),
(60, 4, 'ATAC 3.0.1 rus', 'Данный мод бориться против TeamKill (убийств своей команды).', 'cstrike/', 10),
(61, 4, 'Vote Kick Ban', 'Плагин позволяет админу создавать голосавание за бан или кик игрока. <br>\r\nКоманды: amx_votemenu  <br>\r\namx_votekick   <br>\r\namx_voteban', 'cstrike/', 60),
(62, 4, 'Admin Listen', 'Плагин позволяет админу видеть все чаты в любом состоянии (Жив, мертв, в спектрах)..', 'cstrike/', 48),
(63, 4, 'Amx Unbanmenu', 'Очень удобно разбанивать игроков. Команда админа amx_unbanmenu', 'cstrike/', 56),
(65, 4, '<p>UAIO Admin Menu <span style="color:#FF0000">(не стабильный)</span></p>', 'Универсальная система меню администратора для AMX и AMX Mod X. <br>Команды администратора : uaio_menu', 'cstrike/', 14),
(66, 4, 'Admin Models', '<p><img alt="" src="http://cslider.ru/_ld/3/05987684.jpg" style="float:left; height:156px; margin:5px 15px; width:250px" /></p>\r\n\r\n<p>Оригинальные модели для администраторов</p>\r\n', 'cstrike/', 61),
(67, 9, 'High Ping Kicker (HPK)', 'Плагин который кикает игроков за высокий пинг.', 'cstrike/', 49),
(68, 9, 'Manager CW', 'Этот плагин предназначен для того чтобы организовать ClanWar. Забить cw можно на любой день и время. <br>\r\nКоманды: say /request - подать заявку <br>\r\nsay /edit- редактировать заявку <br>\r\nsay /del - удалить заявку <br>\r\nsay /list - посмотреть список заявок', 'cstrike/', 2),
(69, 4, 'Admin Name', '<p><img alt="" src="http://csru.ru/uploads/posts/2012-06/thumbs/csru.ru_plagin-admin-name-rus.jpg" style="float:left; height:80px; margin:5px 15px; width:200px" /></p>\r\n\r\n<p>Плагин добавляет тег [Админ] в чате</p>\r\n', 'cstrike/', 75),
(70, 4, 'Adminslots', 'Исправленный плагин против уязвимости захода на заполненый сервер.', 'cstrike/', 34),
(71, 4, 'Admin check RUS V2', 'Русифицированный плагин Admin Check, показывает кто из админов онлайн "/admin".', 'cstrike/', 44),
(72, 4, 'Admin Free Look', 'Плагин позволяет администратору следить за игроками обеих команд, независимо от переменной mp_forcechasecam.', 'cstrike/', 44),
(73, 4, 'Map Spawns Editor', 'Плагин позволяет редактировать респауны в игре. <br> \r\nКоманды в консоль:  amx_spawn_editor 1/0 — включение / выключение меню редактирования <br>\r\namx_editor_menu — открыть меню', 'cstrike/', 6),
(75, 4, 'Admin hook', 'Позволяет админам использовать хук для перемещения. кнопка "+hook" (bind v +hook   -  Вы забиндили hook на кнопку v.)', 'cstrike/', 52),
(76, 9, 'Anti DoubleDuck', 'Модуль не дает игроку быстро бегать используя дабл дак.', 'cstrike/', 9),
(77, 4, 'Admin Ghost', 'Этот плагин позволяет админам становится призраками <br>Команды: \r\namx_ghost - зделать себя призраком  <br>\r\namx_unghost - зделать себя нормальным', 'cstrike/', 12),
(78, 4, 'AMX Mute', 'Этот плагин, позволит администратору запретить любому игроку пользоваться любым чатом. Игрок сможет попросить у администратора прощения, определённой командой в чате. <br>Команды: \r\namx_mute [ник] - запретить игроку пользоваться чатом  <br>\r\namx_mute [ник] [мин] - заглушить игрока на определённое время  <br>\r\namx_unmute [ник] - разрешить игроку пользоваться чатом  <br>\r\nsay /sorry - попросить прощения у администратора', 'cstrike/', 43),
(79, 4, 'Admin radar[радар для админа]', 'С помощью этого небольшого плагина сможет видеть на радаре членов своей команды и команды противника.', 'cstrike/', 21),
(80, 4, 'Admin Revive[оживление игроков]', 'Этот плагин позволяет админу оживить игрока, команду, всех на сервере. <bR>\r\nКоманды:  amx_revive', 'cstrike/', 18),
(99, 5, 'Colour Chat RUS', 'Плагин дает возможность любому игроку выбрать цвет чата,написав в чате /colour', 'cstrike/', 16),
(100, 5, 'Join Leave', '<p><img alt="" src="http://csru.ru/uploads/posts/2012-02/csru.ru_plagin-uvedomlyaet-o-podklyuchayuschemya-ili-pokidayuschego-server-join_leave-rus.jpg" style="float:left; height:95px; margin:5px 15px; width:400px" /></p>\r\n\r\n<p>Плагин выводит сообщение слева по центру, такие как: (Ник) Готов грать, Прощаемся с (Ник). Надеемя что ты еще вернёшся.</p>\r\n', 'cstrike/', 24),
(82, 10, 'Cam_Change', '<p><img alt="" src="http://cs-frukt.ru/plagin_mod/camera_changer2.jpg" style="float:left; height:200px; margin:5px 10px; width:400px" /></p>\r\n\r\n<p>Плагин изменяет вид камеры.</p>\r\n\r\n<p>Команды в чат /camera или /cam.</p>', 'cstrike/', 19),
(83, 4, 'admins_online', 'Админы онлайн(на русском)', 'cstrike/', 59),
(84, 4, 'Infected By Virus', 'Этот Plugin заражает игрока. Вирус действует 1 минуту.   Команда - amx_virus', 'cstrike/', 4),
(85, 4, 'Admin Screen 2', 'Этот плагин делает скриншоты экрана игрока во время игры без его ведома. <br>Команды: amx_screen "ник игрока" "количество скринов"', 'cstrike/', 20),
(86, 10, 'amx_piss', 'Данный плагин даёт возможность админам писать на труп. Для работы нужно забиндить кнопку, пример - bind "x" "piss"', 'cstrike/', 13),
(88, 4, 'admin_vgk', 'Выдаёт всем админам гранаты, броню, статус VIP.', 'cstrike/', 72),
(89, 4, 'invisible_spectator', 'Администратор на сервере может следить за игроками в режиме спектаторов и при этом находится в списке игроков за команду. <br>Команда: amx_spectate', 'cstrike/', 19),
(107, 6, 'Ultimate Sounds Female', 'Крики Headshot, multikill, rampage и т.д. женским голосом', 'cstrike/', 75),
(96, 5, 'Colored Translit 3.0', 'Плагин позволяет переключиться на русский и английский язык.', 'cstrike/', 59),
(97, 5, 'Speclist RUS', 'Плагин показывает в правом верхнем углу кто за вами наблюдает. Русская версия.', 'cstrike/', 49),
(98, 5, 'Prochat', 'Плагин, меняющий оформление чата на более красивое, напоминающее CZero. <br>Команды: say /allchat', 'cstrike/', 18),
(92, 5, 'Admin Chat Colors', 'Плагин выделяет сообщения админа любым цветом + видимость всех сообщений.', 'cstrike/', 58),
(101, 5, 'UFPS Anti Advertisements', 'Плагин предназначен для блокировки любых повторяющихся рекламных сообщений от игроков в чате сервера, а также для очистки конфигов игроков от рекламного флуда.', 'cstrike/', 17),
(95, 5, 'Antimats', 'Хороший плагин в борьбе с матом на сервере.', 'cstrike/', 20),
(103, 5, 'Анти-спам Anticommerse RUS', 'Плагин не дает игроку разместить в чате рекламное сообщение. Возможны несколько видов наказания для спамеров. На админов не действует', 'cstrike/', 26),
(106, 6, 'custom_radio', 'С помощью этого плагина, можно русифицировать радио команды и их озвучку', 'cstrike/', 30),
(109, 5, 'ad manager', 'Плагин добавляет цветную рекламу в чат. <br>  !g (Зелёный) !t (T "Красный" CT "Синий" Spectors "Серый"), а если не ставить это перед сообщением, то будет писать обычным цветом.', 'cstrike/', 83),
(110, 9, 'Auto recording demo v.2.0', '<p><img alt="" src="http://xtrust.ucoz.com/kart/70325624.png" style="float:left; height:91px; margin:5px 10px; width:397px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Данный плагин записывает демо на стороне клиента.</p>', 'cstrike/', 78),
(112, 10, 'Parachute', 'В этой версии парашут не надо покупать.При подении нажимаете "E" и летите.', 'cstrike/', 83),
(113, 9, 'no players map', 'Суть плагина заключается в том чтобы когда на сервере нет игроков map меняется допустим на de_dust2_2x2\r\nочень подойдёт для серверов на каторые народ заходит на одну карту', 'cstrike/', 32),
(161, 1, 'AmxModX', 'AMXModX – это версия всем известного модуля управления сервером Counter-Strike 1.6, данный модуль упрощает администрирование сервера, делает его более удобным и приятным. Так же помогает с защитой сервера от читеров.', 'cstrike/', 503),
(115, 7, 'AES: StatsX CStrike', '<p><img alt="" src="http://gf.hldm.org/wp-content/uploads/2014/02/aes_statsx1.jpg" style="float:left; height:176px; margin:5px 10px; width:500px" /></p>\r\n\r\n<p>MOTD окна и сообщения о ранге от системы AES, с отображением ранга и опыта игрока. Включает в себя вывод информации о званиях и необходимый опыт (alist) и таблицу статистики онлайн игроков (astats). С помощью кваров можно полностью перенастроить формирование мотд окн и сообщений. HTML форматирование стиля через словарь. Бесплатная альтернатива AR_StatsX. Плагин перехватывает стандартные команды statsx и заменяет их вывод своим. Остальной функционал в виде HUD сообщений, чата, /me будет зависеть от вашего плагина StatsX.</p>\r\n\r\n<p>&nbsp;После установки,&nbsp;зайти в plugins.ini, вырезать aes_statsx_cstrike.amxx и вставить выше стандартного &nbsp;statsx.amxx</p>\r\n', 'cstrike/', 60),
(116, 10, 'All Death Beams v2', '<p><img alt="" src="http://clansayt-clips.ucoz.ru/09848865.jpg" style="float:left; height:129px; margin:5px 10px; width:250px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>После смерти остаётся траектория выстрела пули. Направление движения полос показывает, откуда вас убили.</p>', 'cstrike/', 16),
(119, 10, 'Sillyc4', 'Плагин позволяет, Ставить с4 на стены', 'cstrike/', 25),
(120, 2, 'Anti HLBrute v1.2', 'Плагин отлавливает Брут Rcon', 'cstrike/', 53),
(121, 9, 'Nice Kicker V2 [Final]', 'Плагин борится против Лагеров, а именно против высокого пинга и больших потерь!', 'cstrike/', 46),
(122, 10, 'Descriptive_Fire_in_the_hole', 'Позволяет смотреть какая граната брошена!', 'cstrike/', 40),
(124, 10, 'Grenade Trail', 'Цветные линии за гранатой.', 'cstrike/', 43),
(125, 10, 'Back Weapons', '<p><img alt="" src="http://www.imgs.su/tmp/1292693232.jpg" style="float:left; height:225px; margin:5px 10px; width:250px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Плагин, позволяющий носить оружие на спине.</p>\r\n', 'cstrike/', 37),
(126, 8, 'Combo Sprites', '<p><img alt="" src="http://arena-meat.at.ua/_ld/0/47591555.jpg" style="float:left; height:125px; margin:5px 10px; width:250px" /></p>\r\n\r\n<p>Плагин который придаст серверу уникальный вид за счёт красивых спрайтов при убийстве</p>\r\n', 'cstrike/', 36),
(130, 8, 'Flashbang Dlight', 'Плагин добавляет эффект вспышки при взрыве flash гранаты.', 'cstrike/', 22),
(131, 9, 'Deagles Map Manager 3.25', 'С помощью него игроки смогут выбирать карты на голосование, а так-же голосовать за досрочную смену текущей карты. Так-же плагин умеет менять карту на нужную, при пустом сервере. <br>mapchoice.ini - проводится голосование когда не была сделана, ни одна из 5 номинаци <br> standardmaps.ini - стандартные карты <br> mapstoban.ini - карты, которые никогда не будут доступны для номинации игроками и которые не будут отображаться в голосованиях <br> allmaps.txt - Карты, находящиеся в этом списке, будут отображаться при вводе команды "listmaps" <br> Зайти в plugins.ini и удалить либо закомментировать nextmap.amxx и mapchooser.amxx', 'cstrike/', 32),
(132, 7, 'INFO В НАЧАЛЕ РАУНДА', '[Info] Раунд: (№ Раунда) | Карта: (Текущая карта) | Игроков: (Кол-во игроков/Макс. кол-во игроков)', 'cstrike/', 36),
(133, 8, 'Bad Camper', 'Плагин, борющийся против кемперов (игроков, которые очень долго находятся на одном месте).', 'cstrike/', 21),
(134, 8, 'AMX_GORE_ULTIMATE', 'Больше крови и мяса', 'cstrike/', 29),
(135, 9, 'auto_restart_vl', 'После того как сменилась карта не все игроки успевают зайти и начать играть с первого раунда, чтобы восстановить справедливость можно использовать данный плагин.', 'cstrike/', 52),
(136, 4, 'Nice Voice 2.0', 'Данный плагин активирует микрофон у определённого игрока и вы можете послушать его всем сервером. <br> Консольные команды:\r\nnice_voice - вызвать меню игроков. Доступно игрокам с флагом H = t. <br>\r\nnice_voice_off - функция откл. микрофон, если игрок сам не догадывается.', 'cstrike/', 13),
(138, 8, 'Frost Nade [ледяная граната]', 'Plugin превращает гранату Smoke в ледяную, которая замораживает врагов.', 'cstrike/', 16),
(139, 10, 'Гранаты после смерти', 'После смерти игрока ,если у него взапасе есть гранаты , они появятся рядом с трупом и их можно будет подобрать.', 'cstrike/', 52),
(140, 10, 'Призы за лучшего игрока раунда', 'очень интересная система наград , её суть заключается в том , что в конце каждого раунда лучшему игроку с лучшим результатом за раунд , открывается меню награды в котором он может выбрать приз , все призы в меню рандомные , к примеру , открывается меню награды , вы выбираете оружие и вам рандомно выдаётся оружие от deagle до awp , так же и с деньгами , может выпасть любое кол-во денег от 1 до 16,000$', 'cstrike/', 29),
(141, 10, 'unreal v 1.2', 'плагин, добавляющий эффект при убийстве. Например, если вы убили несколько человек за раунд - в конце раунда будет звук Unreal и HUD сообщение с вашим ником и количеством фрагов за раунд. Все настройки регулируются кварами.', 'cstrike/', 16),
(142, 7, 'Cчётчик убийств в виде спрайта', 'Простой плагин который информирует о количестве убийств в левом углу игрового интерфейса', 'cstrike/', 26),
(145, 8, 'Снег на вашем сервере', 'Обычный снег,с ним хорошо и удобно играть)', 'cstrike/', 22),
(144, 9, 'FullSpawns', 'Благодаря данному плагину, такие карты как cs_assault, de_nuke, cs_italy,de_train будут поддерживать максимальное количество спаунов! Тоесть все игроки смогут играть на данных картах, а не быть в режиме наблюдающего.', 'cstrike/', 21),
(146, 8, 'Туман', 'Туман на сервере', 'cstrike/', 10),
(147, 8, '[Metamod] Semiclip 1.9', 'Позволяет проходить сквозь игроков', 'cstrike/', 81),
(166, 14, 'SourceMod', 'SourceMod – это свежая версия всем известного модуля управления сервером Counter-Strike Source, данный модуль упрощает администрирование сервера, делает его более удобным и приятным. Так же помогает с защитой сервера от читеров.', 'cstrike/', 47),
(160, 3, 'JAILBREAK EXTREME V1.9', '<p><span style="color:#FFF0F5;">В чем заключается смысл джайла, а точнее Джайлбрек серверов? Сейчас я Вам расскажу.&nbsp;<br />\nНа серверах с модом JailBreak существуют 2 команды.&nbsp;<br />\n<strong>TT</strong>&nbsp;- это Зеки, которые играют за команду террористов. За зеков вы можете:&nbsp;<br />\n1) Быть послушным и выполнять приказы главного охранника.&nbsp;<br />\n2) Быть бунтарём и пытаться убить охрану и совершить побег.&nbsp;<br />\n3) Быть стукачом и сливать всю информацию о побегах охране.&nbsp;<br />\n<strong>CT</strong>&nbsp;- это Охрана, которая должна следить за зеками. В большинстве случаев это 4-6 человек с оружием, которые не должны дать зекам сбежать из зоны заключения под стражу. Так же есть Главный охранник, который отдаёт приказы заключенным.&nbsp;<br />\nВообщем&nbsp;<strong>JailBreak мод для кс 1.6</strong>&nbsp;веселый и интересный. Можно играть с зеками в разнообразные игра на jailbreak картах. Все&nbsp;</span><a class="link" href="http://cs-mod.ru/load/karty_dlja_cs_1_6/jailbreak_karty/133" rel="nofollow" target="_blank"><span style="color:#FFF0F5;">jailbreak </span></a><span style="color:#FFF0F5;">карты для кс 1.6&nbsp;Вы можете так же найти у нас на сайте.&nbsp;<br />\nКогда остаётся один заключенный - ему выдаётся меню дуэлей для схватки на разном оружие против охраны. Побеждает сильнейший.&nbsp;</span><br />\n&nbsp;</p>\n\n<p><span style="color:#FFF0F5;"><strong>Команды мода:</strong>&nbsp;</span></p>\n\n<div class="uSpoilerOpened" id="uSpoilerrw8qlp">\n<div class="uSpoilerButBl"><span style="color:#FFF0F5;"><strong>say /simon</strong>&nbsp;</span></div>\n\n<div class="uSpoilerText"><span style="color:#FFF0F5;">Команда для использования главной роли за охрану - Саймон. Кто первый из охранников напишет эту команду, тот и будет главным и будет отдавать приказы заключенным.&nbsp;<br />\n<strong>say /nomic&nbsp;</strong><br />\nКоманда для охранников, у которых нет микрофона. При написании в чат этой команды - игрока автоматически переведет за заключенных.&nbsp;<br />\n<strong>say /open</strong>&nbsp;<br />\nКоманда только для Главного охранника (Саймона). Данная команда открывает главные клетки с заключенными.&nbsp;<br />\n<strong>say /fd</strong>&nbsp;<br />\nПри использовании данной команды откроется меню для выдачи свободного дня заключенным. Команду может использовать только Саймон и Администратор сервера.&nbsp;<br />\n<strong>say /box</strong>&nbsp;<br />\nДанную команду может использовать только Саймон. При активации это команды, включается бокс между заключенными, то есть они могут убивать друг друга.&nbsp;<br />\n<strong>say /help</strong>&nbsp;<br />\nЭта команда для вывода на экран правил игры.&nbsp;<br />\n<strong>say /duel</strong>&nbsp;<br />\nЭта команда может использоваться последним заключенным. При написании в чат команды /duel, последнему зеку откроется меню выбора оружия, на котором он сможет сыграть дуэль против охранников.&nbsp;</span></div>\n\n<p>&nbsp;</p>\n</div>\n', 'cstrike/', 43),
(232, 1, 'dproto для версии 5787', '<p><span style="color:#FFF0F5;">С помощью этого плагина могут заходить nonsteam игроки.</span></p>\n\n<p><span style="color:#FFF0F5;"><strong>Требовани:</strong></span></p>\n\n<p><span style="color:#FFF0F5;">в файле&nbsp;addons/metamod/plugins.ini &nbsp;строчка&nbsp;</span><span style="color:#FF0000;">&quot;linux addons/dproto/dproto_i386.so&quot;</span><span style="color:#FFF0F5;">&nbsp;Должна быть на самом верху.</span></p>\n', 'cstrike/', 467),
(165, 1, 'Настройки сервера', 'Настройки server.cfg, motd.txt и mapcycle.txt <br>\r\nНужно подключить, что бы отображалось во вкладке "Файлы"', 'cstrike/', 412),
(167, 14, 'Настройки сервера', 'Настройки server.cfg, motd.txt и mapcycle.txt, maplist.txt <br>\r\nНужно подключить, что бы отображалось во вкладке "Файлы"', 'cstrike/', 36),
(361, 2, 'Anti Reliable channel overflowed, убираем вылет игроков', 'Многие наверное слышали про ошибку "Reliable channel overflowed" с которой игроков выкидывает с сервера. Ошибка часто возникает при отправке клиенту кучи сообщений (не обязательно в чат, могут быть команды и т.п.), так же может возникать при использовании тяжелого MOTD окна на сервере.\r\nДанный плагин не исправляет проблему сервера, однако он не позволяет выкинуть игрока с такой причиной. В большинстве случаев игрок продолжит игру на сервере.', 'cstrike/', 8),
(170, 15, 'Настройки сервера', 'Настройки server.cfg, motd.txt и mapcycle.txt, maplist.txt \r\nНужно подключить, что бы отображалось во вкладке "Файлы"', 'cstrike/', 56),
(171, 16, 'MyID', 'Данный плагин позволит игрокам на вашем сервере узнать свой SteamId прописав команду в чате: !myid', 'cstrike/', 6),
(173, 17, 'BanV34', 'Бан по железу для сервера css v34- Как вы знаете сейчас многие игроки обходят бан на ваших серверах, меняют STEAM ID или IP адрес, так вот этот плагин будет давать бан по другой системе.<br>\r\nКоманда в консоль: sm_banv', 'cstrike/', 9),
(174, 24, 'Blocker Passes', 'Плагин позволяет администратору сервера через админ меню устанавливать в нужных местах блокирующие проход и включить автоматическую установку этих предметов каждый раунд, если игроков на сервере меньше, чем указано к конфиге плагина.', 'cstrike/', 11),
(175, 16, 'Пояс смертника', 'Добавит игрокам использовать пояс смертника. <br>\r\nЧтобы пояс взорвался надо забиндить кнопку:\r\n"bind k detonate"', 'cstrike/', 4),
(177, 23, 'Падающий снег', 'Данный плагин добавит на ваш сервер падающий снег,', 'cstrike/', 2),
(178, 23, 'Grenade trails', 'Плагин будет отображать траекторию гранат', 'cstrike/', 9),
(179, 19, 'Admin Player Team v.0.2.4 Rus', '<p><img alt="" src="http://cssmaps.ucoz.org/_ld/4/463.png" style="float:left; height:171px; margin-left:20px; margin-right:20px; width:250px" /></p>\n\n<p>&nbsp;</p>\n\n<p><span style="color:#FFF0F5;">&nbsp;C помощью данного плагина админ на вашем сервер сможет менять игрокам команду, и кидать их в наблюдение.</span></p>\n', 'cstrike/', 9),
(180, 16, 'TeamBets v.2.6', 'Данный плагин позволяет игрокам, делать ставки на одну из команд, какая команда выиграет, той и достанутся деньги', 'cstrike/', 4),
(185, 21, 'quake_sounds', 'Большой набор Quake-звуков: Голосовое приветствие, 1 набор квейк-звуков (на русском).', 'cstrike/', 5),
(187, 20, 'Advertisements', 'Это простой плагин рекламы основан на basechat. Он поддерживает такие команды как : say, csay, hsay, msay и tsay.', 'cstrike/', 9),
(188, 24, 'Players Votes', 'Плагин добавляет возможность голосований обычным игрокам. Они могут голосовать за кик игрока с сервера votekick, за бан voteban, за отключение игроку возможности говорить и писать в чат votemute и голосовать за немедленное изменение карты или за изменение карты по окончании timelimit votemap <br>\r\nКоманды: say votekick, voteban, votemap и votemute для использования игроками.', 'cstrike/', 12),
(189, 21, 'Quake Sounds 2', 'Этот плагин проигрывает Quake звуки. В настоящее время он состоит из двух отдельных наборов звуков, стандартный набор (мужским голосом) и набор звуков женским голосом. Звуки, которые проигрываются во время событий, могут быть настроены. Это позволяет пользователям иметь индивидуальные настройки звука и сохранять эти настройки в различных сессиях. Также плагин отображает локализованный текст сообщения для каждого события. Вы можете добавить или удалить звук со множеством дополнительных наборов', 'cstrike/', 6),
(190, 22, 'SoD Stats', '<p><span style="color:#FFF0F5;">Игрок получает 2 очка за убийство, плюс одно дополнительное очко за каждые 100 очков у жертвы. Жертва теряет столько же очков, сколько приобретает её убийца. Это делается для того чтобы действительно классный игрок не мог повысить свою статистику убивая новичка снова и снова. Аналогично, когда опытный игрок присоединиться к игре, он сможет быстро набрать высокий рейтинг статистики, потому что все остальные начнут с гораздо большим количеством очков. Такая система статистики наиболее правильно определяет уровень квалификации игроков и индивидуальное мастерство.&nbsp;</span></p>\n\n<p><span style="color:#FFF0F5;">Команды:<br />\nsm_stats_reset - сбросить статистику всех игроков.<br />\nsm_stats_purge [#days] - удалить игроков, которые не играли в течении [#days] дней, из базы данных.</span></p>\n\n<p><span style="color:#FFF0F5;">Напишите в чат &quot;rank&quot; чтобы увидеть ваш ранг.<br />\nНапишите в чат &quot;top&quot; или &quot;top10&quot; чтобы увидеть десять лучших игроков.<br />\nНапишите в чат &quot;session&quot; или &quot;statsme&quot; для показа вашей подробной статистики и текущей сессии.</span></p>\n', 'cstrike/', 13),
(191, 21, 'mapchooser + sound', 'Теперь когда выводится меню голосования за карту еще и проигрывается звук.', 'cstrike/', 6),
(193, 24, 'AFK Manager', 'Плагин проверяет местонахождение игроков каждые 5 секунд, и если через установленное в настройках время игрок так и не сдвинется с места и не совершит никаких действий (например не общается в чате), то он кикается с сервера через заданный промежуток времени.', 'cstrike/', 5),
(194, 23, 'Show Damage', 'Плагин показывает на экране нанесенные повреждения.', 'cstrike/', 11),
(195, 18, 'DeathMatch:SM v.1.8.0', 'Расширенный режим deathmatch, включающий в себя elimination режим выбывания и spawn protection защиту при появлении. <br>\r\nКоманды: sm_ggdm_spawn_menu - редактировать точки появления GG DM', 'cstrike/', 3),
(196, 21, 'Advanced c4 timer', 'Плагин добавляет таймер бомбы в игру. Есть возможность настроить звуки отсчета.', 'cstrike/', 8),
(198, 25, 'Socket v.3.0.1', 'Это расширение увеличивает сетевые функции SourceMod''a. Требуется для работы большого количества плагинов работающих непосредственно с сетью.', 'cstrike/', 19),
(199, 25, 'SteamTools', 'Расширение дает доступ к некоторым SteamWorks функциям для плагинов SourceMod', 'cstrike/', 15),
(258, 27, 'Настройки сервера', 'Настройки server.cfg, motd.txt и mapcycle.txt и другое', 'csgo/', 21),
(259, 41, 'Drop Random Health Pack', 'Плагин с помощью которого вы можете настроить на вашем сервере выпадающие с убитых игроков паки с здоровьем , выпадать они будут рандомно , кол-во даваемого HP настраивается в кварах... ', 'csgo/', 2),
(201, 18, 'WarMod', '<p><img alt="" src="http://ss-css.do.am/b2927308f651.jpg" style="float:left; height:100px; margin:5px 25px; width:250px" /><span style="color:#FFF0F5;">Требования для работы плагина:<br />\nSourcemod (Вспомогательные плагины)<br />\nSocket v3.0.1 (Вспомогательные плагины)<br />\nПлагин предназначен для проведения кв в CS:S матчах, может быть использован совместно с Stripper:Source (чтобы устранить беспорядок, такой, как бочки и мусор) и zBlock (блокирует недопустимые нарушающие правила команды).</span></p>\n', 'cstrike/', 3),
(204, 16, 'Кидание ножей', 'Данный плагин позволит игрокам на сервере, кидать ножи в противника.', 'cstrike/', 4),
(205, 28, 'Кидание ножей', 'Данный плагин позволит игрокам на сервере, кидать ножи в противника.', 'cstrike/', 10),
(208, 25, 'SDK Hooks', 'Это расширение позволяет использовать некоторые полезные функции. Необходимо при использовании некоторых модов и плагинов. Ранее расширение называлось Hacks Extension.', 'cstrike/', 13),
(207, 37, 'SDK Hooks', 'Это расширение позволяет использовать некоторые полезные функции. Необходимо при использовании некоторых модов и плагинов. Ранее расширение называлось Hacks Extension.', 'cstrike/', 28),
(209, 35, 'spawn effec', '<p><span style="color:#FFF0F5;">​Плагин spawn effect создаёт искры при заходе на сервер игрока, то есть когда игрок начинает игру с респы свой первый раунд с него сыплются искры! Очень красиво смотрится!&nbsp;</span></p>\n\n<p><span style="color:#FFF0F5;">Требуется: EventScripts</span></p>\n', 'cstrike/', 10),
(244, 37, 'EVENTSCRIPTS', 'Игровой менеджер для вашего orangebox сервера', 'cstrike/', 17),
(212, 23, 'spawn effec', '<p><span style="color:#FFF0F5;">​Плагин spawn effect создаёт искры при заходе на сервер игрока, то есть когда игрок начинает игру с респы свой первый раунд с него сыплются искры! Очень красиво смотрится!&nbsp;</span></p>\n\n<p><span style="color:#FFF0F5;">Требуется: EventScripts</span></p>\n', 'cstrike/', 3),
(213, 29, 'Anti Console Flood', 'Не позволяет игроку слишком часто использовать команды в игровом консоле. Злоумышленники могут мучать сервер и даже заставить его упасть, используя консольные команды в alias''ах и тд - чтобы они как можно чаще вызывались и грузили сервер.', 'cstrike/', 17),
(214, 17, 'Anti Console Flood', 'Не позволяет игроку слишком часто использовать команды в игровом консоле. Злоумышленники могут мучать сервер и даже заставить его упасть, используя консольные команды в alias''ах и тд - чтобы они как можно чаще вызывались и грузили сервер.', 'cstrike/', 7),
(215, 24, 'AFK Ping Control v1.2', 'Отключает от сервера неактивных игроков, или игроков с большим пингом.', 'cstrike/', 5),
(216, 36, 'AFK Ping Control v1.2', 'Отключает от сервера неактивных игроков, или игроков с большим пингом.', 'cstrike/', 21),
(217, 34, 'Stats after death', 'Простой плагин, который позволяет использовать чат-команды !me или "/me" , информация о нанесенном уроне и команда <br>"!hp" или "/hp", сведения об убийце все эти команды работают после смерти.<br>\r\nМожно также использовать команду после окончания раунда.', 'cstrike/', 11),
(345, 30, 'DEATHMATCH', '<p>Основные функции:<br />\r\n&bull; Ограничение респаунов игрока (система жизней)<br />\r\n&bull; Увеличение денежной награды за убийство кого-то конкретным оружием<br />\r\n&bull; Награда доминирования - когда игрока убивает один конкретный человек много раз подряд, он крадет $ 1000 от потерпевшго (или все деньги, которые он имеет, если у него меньше, чем $ 1000) и доминирующий игрок награждается $ 500 за каждое убийство .<br />\r\n&bull; Расширенная система защиты респауна [Spawn protection] - игрок не только будет не уязвим в ходе защиты респауна, но еще он будет невидимым.<br />\r\n&bull; Меню покупки жизней<br />\r\n&bull; Построение автоматической ATM/bank системы<br />\r\n&bull; Вознаграждения дополнительными жизнями<br />\r\n&bull; Меню покупки здоровья (health)/автоматическая система здоровья<br />\r\n&bull; Много Headshot&#39;ов подряд награждается жизнью. Стандартно 4 headshot&#39;а подряд.<br />\r\n&bull; Удаление трупов<br />\r\n&bull; Пользовательское меню закупки<br />\r\n&bull; Многое другое ...</p>\r\n\r\n<p>Админские команды:<br />\r\nsm_dmweapon установить режим денежной компенсации для конкретного вида оружия<br />\r\nsm_addspawn добавляет точку респауна<br />\r\nsm_itemcost позволяет администратору изменять цены на покупку оружия<br />\r\nsm_backpack позволяет администратору просматривать содержимое &quot;рюкзаков&quot; игроков<br />\r\nКонсольные команды:<br />\r\nbuy_menu - открыть меню покупки оружия<br />\r\ndm_rebuy - повторная покупка последнего купленного оружия<br />\r\ndm_swap_primary - позиция первичного оружия как прикрепленного сзади или смена первичного оружия.<br />\r\nКоманды доступные в чате:<br />\r\n!buylife - открыть меню покупки жизней<br />\r\n!info - отобразить количество жизней и полосу доминирования<br />\r\nhelp - показать полезные данные в чате<br />\r\n!spawn - отнимает одну жизнь, и респаунит игрока<br />\r\nbuy - открыть меню покупки оружия</p>', 'cstrike/', 6);
INSERT INTO `gh_addons` (`id`, `cat`, `name`, `info`, `dir`, `install`) VALUES
(346, 18, 'DEATHMATCH', '<p>Основные функции:<br />\r\n&bull; Ограничение респаунов игрока (система жизней)<br />\r\n&bull; Увеличение денежной награды за убийство кого-то конкретным оружием<br />\r\n&bull; Награда доминирования - когда игрока убивает один конкретный человек много раз подряд, он крадет $ 1000 от потерпевшго (или все деньги, которые он имеет, если у него меньше, чем $ 1000) и доминирующий игрок награждается $ 500 за каждое убийство .<br />\r\n&bull; Расширенная система защиты респауна [Spawn protection] - игрок не только будет не уязвим в ходе защиты респауна, но еще он будет невидимым.<br />\r\n&bull; Меню покупки жизней<br />\r\n&bull; Построение автоматической ATM/bank системы<br />\r\n&bull; Вознаграждения дополнительными жизнями<br />\r\n&bull; Меню покупки здоровья (health)/автоматическая система здоровья<br />\r\n&bull; Много Headshot&#39;ов подряд награждается жизнью. Стандартно 4 headshot&#39;а подряд.<br />\r\n&bull; Удаление трупов<br />\r\n&bull; Пользовательское меню закупки<br />\r\n&bull; Многое другое ...</p>\r\n\r\n<p>Админские команды:<br />\r\nsm_dmweapon установить режим денежной компенсации для конкретного вида оружия<br />\r\nsm_addspawn добавляет точку респауна<br />\r\nsm_itemcost позволяет администратору изменять цены на покупку оружия<br />\r\nsm_backpack позволяет администратору просматривать содержимое &quot;рюкзаков&quot; игроков<br />\r\nКонсольные команды:<br />\r\nbuy_menu - открыть меню покупки оружия<br />\r\ndm_rebuy - повторная покупка последнего купленного оружия<br />\r\ndm_swap_primary - позиция первичного оружия как прикрепленного сзади или смена первичного оружия.<br />\r\nКоманды доступные в чате:<br />\r\n!buylife - открыть меню покупки жизней<br />\r\n!info - отобразить количество жизней и полосу доминирования<br />\r\nhelp - показать полезные данные в чате<br />\r\n!spawn - отнимает одну жизнь, и респаунит игрока<br />\r\nbuy - открыть меню покупки оружия</p>\r\n', 'cstrike/', 0),
(221, 4, 'AMXBans GM 1.6', '<p><img alt="" src="http://prostrell.clan.su/amxbansnew.png" style="border-style:solid; border-width:0px; float:left; height:100px; margin:5px 10px; width:250px" /><span style="color:#FFF0F5;"><strong>AMXBans GM 1.6</strong><span style="font-family: tahoma, helvetica, sans-serif; font-size: 13px;">&nbsp;- пожалуй одна из самых популярных систем банов для сервера CS 1.6 с помощью которой вы сможете организовать в одно время сложную но в другое время очень простую и юзабильную связку между вашим сервером и сайтом. Хотите прописывать Админки через веб интерфейс , с возможностью авто отключением Админа после того как того или иного Админа выйдет срок действия или же по прежнему через файл users.ini.&nbsp;</span></span></p>\n\n<p><span style="color:#FFF0F5;"><span style="font-family: tahoma, helvetica, sans-serif; font-size: 13px;">Требование: <strong>WEB интерфейс</strong>&nbsp;</span><strong>AMXBans GM 1.6</strong></span></p>\n\n<p><span style="color:#FFF0F5;">После того, как вы установите плагин с панели, Нужно будет зайти в plugins.ini&nbsp;(addons/amxmodx/configs/plugins.ini)&nbsp;и с самого низа поднять на самый верх 2 плагина:</span></p>\n\n<p><span style="color:#FFF0F5;">amxbans_core.amxx</span></p>\n\n<p><span style="color:#FFF0F5;">amxbans_main.amxx</span></p>\n\n<p>&nbsp;</p>\n', 'cstrike/', 81),
(222, 10, 'VIP Menu by CyX', '<p><img alt="" src="http://cscontrol.ru/_ld/42/21046498.jpg" style="float:left; height:180px; margin:5px 10px; width:154px" />&nbsp; &nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><span style="color:#FFF0F5;"><span style="font-family:tahoma,helvetica,sans-serif; font-size:13px">Этот плагин дает возможности VIP игрокам</span></span></p>\n\n<p><br />\n<span style="color:#FFF0F5;">Вызов VIP - /vipmenu</span></p>\n\n<p><span style="color:#FFF0F5;"><span style="font-family:tahoma,helvetica,sans-serif; font-size:13px">Что бы прописать игроку VIP в users.ini игроку тег </span><strong><span style="font-family:tahoma,helvetica,sans-serif; font-size:13px">&quot;d&quot;</span></strong></span></p>\n', 'cstrike/', 48),
(224, 10, 'Bunny Hop Enabler (Распрыг на сервере)', 'Маленький плагин, который позволяет без особых усилий делать просто нереальный распрыг.', 'cstrike/', 29),
(225, 10, 'Прикольная Паутинка', '<p><span style="font-family:verdana; font-size:12px">В этой версии заменен звук, и вид самой паутинки.</span></p>\r\n<p><span style="font-family:verdana; font-size:12px">Бинд паутинки:&nbsp;</span><strong><span style="color:#FF0000"><span style="font-family:verdana; font-size:12px">bind f +hook</span><span style="font-family:verdana; font-size:12px">&nbsp;</span></span></strong><br />\r\n<span style="font-family:verdana; font-size:12px">Теперь жмём на&nbsp;</span><span style="font-family:verdana; font-size:12px">f</span><span style="font-family:verdana; font-size:12px">&nbsp;и летим!</span></p>', 'cstrike/', 38),
(228, 2, 'CHBlock 2.2', 'Данный анти чит блокирует почти все виды WH,cdHack,eHack,Protector и ещё пару читов.При обнаружении перед блокировкой игрока данные записываются в лог.Можно настроить тип блокировки,время блокировки.По моему мнению единственный недостаток этого анти чита - отсутствие SpeedHack детектора', 'cstrike/', 67),
(230, 14, 'Настройки  SourceTV', 'Source TV дает возможность неограниченному числу зрителей наблюдать за ходом матча на выделенном сервере Source. SourceTV зрители невидимы игрокам матча и не могут никак влиять на ход игры. Камера SourceTV может управляться как самим сервером так и непосредственно человеком, будучи ответственным за управлению ею. Вещание матча через SourceTV может передаваться с некоторым заранее заданным временным интервалом. Эта возможность страхует от вероятности того, что игроки могут воспользоваться SourceTV, чтобы получить какую-либо информацию об их оппонентах.\r\nОрганизация SourceTV для вещания нескольким зрителям не требует никаких особых временных затрат и ресурсов сервера. Организация же вещания для тысяч зрителей может потребовать предварительной подготовки и серьезных требований к серверу.', 'cstrike/', 15),
(234, 19, 'Admin Player Grabber - Захват и перемещение игроков', '<p><span style="color:#FFF0F5;">Позволяет администраторам захватывать и передвигать игроков. Плагин должен работать в любой игре.<br />\nЗахват имеет 2 режима:&nbsp;<br />\nРежим по умолчанию будет захватывать игрока и сам приводить его к вам.&nbsp;<br />\nВторой режим использует правую кнопку мыши. Если вы ее держите и используете команду захвата, то плагин будет держать игрока на расстоянии.&nbsp;<br />\nАналогичным образом, если вы захватили игрока с использованием правой кнопки мыши и команды грабинга, то при повторного использования команды грабинга плагин бросит игрока.</span></p>\n\n<p><span style="color:#FFF0F5;">Требования:<br />\nSDKHooks</span></p>\n\n<p><span style="color:#FFF0F5;">Команды:<br />\nsm_grab: (нужен флаг slay) переключает на режим захватывания игрока.</span></p>\n', 'cstrike/', 5),
(235, 31, 'Admin Player Grabber - Захват и перемещение игроков', '<p><span style="color:#FFF0F5;">Позволяет администраторам захватывать и передвигать игроков. Плагин должен работать в любой игре.<br />\nЗахват имеет 2 режима:&nbsp;<br />\nРежим по умолчанию будет захватывать игрока и сам приводить его к вам.&nbsp;<br />\nВторой режим использует правую кнопку мыши. Если вы ее держите и используете команду захвата, то плагин будет держать игрока на расстоянии.&nbsp;<br />\nАналогичным образом, если вы захватили игрока с использованием правой кнопки мыши и команды грабинга, то при повторного использования команды грабинга плагин бросит игрока.</span></p>\n\n<p><span style="color:#FFF0F5;">Требования:<br />\nSDKHooks</span></p>\n\n<p><span style="color:#FFF0F5;">Команды:<br />\nsm_grab: (нужен флаг slay) переключает на режим захватывания игрока.</span></p>\n', 'cstrike/', 14),
(238, 21, 'RoundEndSound - 73 нарезки', 'Плагин проигрывает музыку в конце раунда.', 'cstrike/', 6),
(237, 33, 'RoundEndSound - 73 нарезки', 'Плагин проигрывает музыку в конце раунда.', 'cstrike/', 21),
(240, 23, 'Killmessages v2.3 By xeon', '<p><img alt="" src="http://for-css.ru/_ld/141/14141.jpg" style="float:left; height:169px; margin:5px 10px; width:225px" /><span style="color:#FFF0F5;">Cовершенно новая версия Killmessages v2.3 by xeon теперь и в серебристо-зеленых тонах! Данный плагин работает на sourcemode и при совершенном убийстве\\серии убийств выводит на экран overley-ное сообщение,По многочисленным просьбам эта версия overley-надпись выполнена чисто на английском и без лишних изображений крови и т.п.Этот плагин отлично украсит ваш сервер</span></p>\n\n<p><span style="color:#FFF0F5;">Требования:</span></p>\n\n<p><span style="color:#FFF0F5;">SourceMOD (последней версии)</span></p>\n\n<p><span style="color:#FFF0F5;">SDK Hooks (последней версии)</span></p>\n', 'cstrike/', 5),
(245, 1, 'Настроки HLTV', 'Half-Life TV предоставляет возможность неограниченному числу зрителей наблюдать за игрой в режиме реального времени (возможно, с небольшой задержкой). Зрители имеют возможность наблюдать за игрой так, как будто они находятся на сервере в качестве спектаторов, свободно летать по карте, наблюдать за игроком от третьего лица или из его глаз, следить за игрой на плане карты, а также в смешанном режиме следить одновременно и за игроком и за планом карты.', '/', 126),
(246, 10, 'DeathRun Duel 2.5.1', '<p><span style="font-family:verdana,arial,helvetica; font-size:10.6666669845581px">Новые дуэли для детран мода с очередями. Пока что CT не стрельнет, у Т в оружие патронов не будет.</span></p>\n\n<p><font face="verdana, arial, helvetica"><span style="font-size:10.6666669845581px">Для админа: &nbsp;&nbsp;</span></font><span style="color:#FF0000"><strong>dd_origin_menu</strong></span><span style="font-family:tahoma; font-size:12px">&nbsp;- Открыть меню точек телепортации</span></p>\n\n<p><span style="font-family:tahoma; font-size:12px">Для игрока:</span></p>\n\n<p><span style="font-family:tahoma; font-size:12px">* say <span style="color:#FF0000">/lr | !lr&nbsp;</span></span><span style="font-family:tahoma; font-size:12px">- Открыть меню дуэлей&nbsp;</span><br />\n<span style="font-family:tahoma; font-size:12px">*&nbsp;</span><span style="font-family:tahoma; font-size:12px">say <span style="color:#FF0000">/dd | !dd&nbsp;</span></span><span style="font-family:tahoma; font-size:12px">- Открыть меню дуэлей&nbsp;</span><br />\n<span style="font-family:tahoma; font-size:12px">* <span style="color:#FF0000">deathrun_duels&nbsp;</span></span><span style="font-family:tahoma; font-size:12px">- Открыть меню дуэлей</span></p>\n', 'cstrike/', 8),
(247, 10, 'dr_menu.amxx', '<p><img alt="" src="http://ap-host.ru/wysibb/theme/ap-host/imgaddons/dr_menu.jpg" style="float:left; height:209px; margin:5px 10px; width:250px" />&nbsp;</p>\n\n<p>Меню для сервера deachrun</p>\n\n<p><strong>Команды:</strong><span style="font-family:verdana,arial,helvetica; font-size:10.6666669845581px">&nbsp;</span><span style="color:#0000FF"><span style="font-family:verdana,arial,helvetica; font-size:10.6666669845581px"><strong>F3</strong></span></span><span style="font-family:verdana,arial,helvetica; font-size:10.6666669845581px">&nbsp;- открыть меню</span></p>\n', 'cstrike/', 17),
(248, 10, 'dr_lifemenu [Меню покупки жизней]', '<p><img alt="" src="http://ap-host.ru/wysibb/theme/ap-host/imgaddons/life_dr.jpg" style="float:left; height:158px; margin:5px 10px; width:260px" /></p>\n\n<p>Возможность покупать жизни.</p>\n\n<p><strong>Команды для открытия:</strong><span style="font-family:verdana,arial,helvetica; font-size:10.6666669845581px">&nbsp;написать в чате&nbsp;</span><span style="color:#0000FF"><strong>/life&nbsp;</strong></span></p>', 'cstrike/', 16),
(250, 10, '[DR] Ножи v1.2', '<p><img alt="" src="http://cscontrol.ru/_ld/30/3076.jpg" style="float:left; height:200px; margin:5px 10px; width:250px" /></p>\n\n<p>&nbsp;</p>\n\n<p>Несколько ножей для CS</p>\n\n<p>Вызов меню - <span style="color:#FF0000">/knife </span>в чате</p>\n', 'cstrike/', 24),
(253, 4, 'Block Voteban [Блокирует команду voteban]', 'Данный плагин блокирует команду voteban тогда, когда админ на сервере!', 'cstrike/', 44),
(257, 27, 'SourceMod', 'SourceMod  - это плагин для MetaMod:Source, который в свою очередь является прослойкой между движком Source и плагинами', 'csgo/', 28),
(262, 43, '[SM] Levels Ranks', '<p>&nbsp;</p>\n\n<table border="0" cellpadding="1" cellspacing="1" style="width: 650px;">\n	<tbody>\n		<tr>\n			<td>\n			<p><span style="color:#FFF0F5;"><strong>Коротко о Levels Ranks:</strong><span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Выбор ножей&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Выбор скинов для ножей&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Опыт даётся за убийство, убийство гранатой, убийство Молотовым, убийством Зевсом&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Опыт даётся за Double- Triple- Quadro- Penta-kills&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Опыт даётся за действия над бомбой&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Опыт отнимается за самоубийство&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Выставление игрокам званий в зависимости от опыта&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Выбор перчаток по званиям&nbsp;</span></span></p>\n			</td>\n			<td><span style="color:#FFF0F5;"><strong>Команды:</strong><span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">!lvl - открывает главное меню&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">!knife - открывает меню ножей</span></span></td>\n		</tr>\n	</tbody>\n</table>\n\n<p><br />\n&nbsp;</p>\n', 'csgo/', 5),
(263, 41, '[SM] STORE (магазин плюшек)', '<table border="0" cellpadding="1" cellspacing="1" style="width: 650px;">\n	<tbody>\n		<tr>\n			<td colspan="2"><span style="color:#FFF0F5;"><strong>Плагин Store</strong><span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">&nbsp;дает возможность вашим игрокам на сервере CS:GO зарабатывать&nbsp;</span><u>кредиты</u><span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">&nbsp;и&nbsp;</span><u>покупать</u><span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">за них в Магазине различные плюшки в виде : шапок , очков , масок , ножей , различных трейлов , цвет оружия , префиксы к нику и многое многое другое , можно сказать что это уже не плагина , а достаточно хорошая модификация</span></span></td>\n		</tr>\n		<tr>\n			<td>\n			<p><span style="color:#FFF0F5;"><strong><span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Вмагазине имеются: </span></strong></span></p>\n\n			<p><span style="color:#FFF0F5;"><span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Ножи/Knives&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Следы от пуль/Tracers&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Лазерные прицелы/Laser Sight&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Аксессуары/Accessories&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">- Шапки/Hats&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">- Очки/Glasses&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">- Маски/Masks&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">- Щит/Shields&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Скины/Skins&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Трейлы/Trails&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Трейлы гранат/Grenade Trails&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Скины гранат/Grenade Skins&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Цвет оружия/Weapon Colors&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Чат плюшки/Chat stuff&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">- Префиксы к нику/Name Tags&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">- Цвет ника/Name Colors&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">- Цвет сообщения/Message Colors&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Плюшки/Miscellaneous&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">- Пейнтболл/Paintball&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">- Банихоп/Bunnyhop&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">- Джетпак/Jetpack</span></span></p>\n			</td>\n			<td><span style="color:#FFF0F5;"><strong>Открыть магазин:</strong><span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">(консоль) sm_store, sm_shop, sm_market&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">(чат) !store, !shop, !market&nbsp;</span><br />\n			<br />\n			<strong>Открыть ваш инвентарь</strong><span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">(консоль) sm_inv,sm_inventory&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">(чат) !inv,!inventory&nbsp;</span><br />\n			<br />\n			<strong>Показывает сколько у вас кредитов</strong><span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">(консоль) sm_credits&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">(чат) !credits&nbsp;</span><br />\n			<br />\n			<strong>Отправить кредиты игроку</strong><span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">(консоль) sm_givecredits &lt;ник&gt; &lt;сколько кредитов&gt;&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">(чат)!givecredits &lt;ник&gt; &lt;сколько кредитов&gt;&nbsp;</span><br />\n			<br />\n			<strong>Для работы JetPack (бинд)</strong><span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Включить - bind &quot;x&quot; &quot;+jetpack&quot;&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">Выключить - bind &quot;z&quot; &quot;-jetpack&quot;&nbsp;</span></span></td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n', 'csgo/', 3),
(264, 41, '[SM] Weapon Paints', '<table border="0" cellpadding="1" cellspacing="1" style="width: 650px;">\n	<tbody>\n		<tr>\n			<td><span style="color:#FFF0F5;"><strong>Weapon Paints</strong><span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">&nbsp;-&nbsp;</span><strong>плагин для csgo</strong><span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">&nbsp;который позволяет выбрать себе&nbsp;</span><u>скин</u><span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">&nbsp;оружия из меню и собственно с ним бегать , наверное многие игроки хотели бы примерить скин к примеру&nbsp;</span><u>Dragon Lore&nbsp;</u><span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">на свой голый,зеленый AWP</span></span></td>\n			<td><span style="color:#FFF0F5;"><strong>Команды:</strong><span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">!wskins&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">!ws&nbsp;</span><br />\n			<span style="font-family:tahoma,helvetica,sans-serif; font-size:13.3333330154419px">!paints&nbsp;</span></span></td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n', 'csgo/', 7),
(265, 44, 'Headshot Only', 'Плагин ставит запрет на убийство в любую часть тела кроме головы. Так же при убийстве будет проигрываться дефольтный звук с HL2 , вы можете настроить что бы звук проигрывался всем или только убийце игрока , но в плагине есть ещё возможность выставить свои собственные звуки хедшотов.', 'csgo/', 2),
(266, 45, 'Exclusive Deathrun Manager', '<table align="left" border="0" cellpadding="1" cellspacing="1" style="width: 650px;">\n	<tbody>\n		<tr>\n			<td><span style="color:#FFF0F5;"><span style="font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px;">Многие возможно задавались вопросом , а есть ли мод Deathrun для CS:Global Offensive , скажу так , многие плагины SM были сделаны для css и походу дела авторы модов/плагинов немного переделав сделали и под csgo , что бы мод Exclusive Deathrun Manager для csgo работал.</span></span></td>\n			<td>\n			<p><span style="color:#FFF0F5;">Админ команда (sm_setfrags) ADMFLAG_KICK&nbsp;<br />\n			Используйте чтобы забрать фрагиsm_setfrags &quot;user&quot; &quot;-5&quot; отнимаем 5 фрагов) Используйте чтобы добавить фраги (sm_setfrags &quot;user&quot; &quot;5&quot; добавляем 5 фрагов)&nbsp;</span></p>\n\n			<p><span style="color:#FFF0F5;">Админ Меню ([DR] Управление игроками) ADMFLAG_KICK&nbsp;<br />\n			Воскрешение игроков (обычное воскрешение)&nbsp;<br />\n			Сделать Террористом (в новом раунде будет выбран террорист которого вы указалаи (максимум 3))&nbsp;</span></p>\n\n			<p><span style="color:#FFF0F5;">Клиент команды&nbsp;<br />\n			в чат [ /, ! ] scout - Для получения скаута!&nbsp;<br />\n			в чат [ /, ! ] rs, resetscore - Для обнуления статистики смертей!&nbsp;</span></p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n', 'csgo/', 1),
(268, 42, 'Advanced Rules Menu', '<p><img alt="" src="http://ap-host.ru/wysibb/theme/ap-host/imgaddons/rules.jpg" style="width: 350px; height: 218px; float: left; margin: 5px 10px;" /></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px;">Cлужит как соглашение с правилами , игроку дается выбор , если он не соглашается с правилами нажав на соответственный пункт , то его сразу кикнит с сервера , таким способом вы сможете опровергнуть любые нарушения за счет этого плагина</span></p>', 'csgo/addons/sourcemod/', 4),
(270, 41, '[Shop] Core', '<p><span style="font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px;">Магазин для вашего сервера csgo , валюта данного магазина отделяется от валюты за которую Вы покупаете девайсы на сервере , в этом плагин валюта в виде кредитов. У Вас появится возможность купить предметы или продать вещи из вашего инвентаря.&nbsp;</span><br style="color: rgb(40, 40, 40); font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px; background-color: rgb(230, 230, 230);" />\n<br style="color: rgb(40, 40, 40); font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px; background-color: rgb(230, 230, 230);" />\n<span style="font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px;">Особенность [Shop] Core v1.9.3 это - поддержка MySQL, SQLite баз , то есть Вы сможете выводить статистику магазина прямо на свой web сайт и это и есть изюминка плагина!&nbsp;</span></p>\n\n<p><strong>Команды в чате</strong><br style="color: rgb(40, 40, 40); font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px; background-color: rgb(230, 230, 230);" />\n<span style="font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px;"><span style="color:#0000FF;">!shop</span> или<span style="color:#0000FF;"> /shop</span> или<span style="color:#0000FF;"> !store</span> или <span style="color:#0000FF;">/store</span> - для открытия главного меню магазина&nbsp;</span><br style="color: rgb(40, 40, 40); font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px; background-color: rgb(230, 230, 230);" />\n<span style="font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px;"><span style="color:#0000FF;">!inv</span> или <span style="color:#0000FF;">/inv</span> или <span style="color:#0000FF;">!inventory</span> или <span style="color:#0000FF;">/inventory</span> - для открытия инвентаря&nbsp;</span></p>\n\n<p><strong>Админ ROOT</strong><br style="color: rgb(40, 40, 40); font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px; background-color: rgb(230, 230, 230);" />\n<span style="font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px;"><span style="color:#0000FF;">!givecredits</span> или <span style="color:#0000FF;">/givecredits</span> &lt;ник&gt; &lt;кол-во кредитов&gt; - Чтобы дать кредиты игроку&nbsp;</span><br style="color: rgb(40, 40, 40); font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px; background-color: rgb(230, 230, 230);" />\n<span style="font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px;"><span style="color:#0000FF;">!takecredits</span> или <span style="color:#0000FF;">/takecredits</span> &lt;ник&gt; &lt;кол-во кредитов&gt; - Чтобы забрать кредиты у игрока&nbsp;</span><br style="color: rgb(40, 40, 40); font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px; background-color: rgb(230, 230, 230);" />\n<span style="font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px;"><span style="color:#0000FF;">!setcredits</span> или <span style="color:#0000FF;">/setcredits</span> &lt;ник&gt; &lt;кол-во кредитов&gt; - Чтобы установить кредиты игроку&nbsp;</span><br style="color: rgb(40, 40, 40); font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px; background-color: rgb(230, 230, 230);" />\n&nbsp;</p>\n\n<p><strong>Команды в консоле</strong></p>\n\n<p><span style="color:#0000FF;"><span style="font-family: Verdana; font-size: 12px;">sm_shop, sm_store</span></span><span style="color: rgb(75, 75, 75); font-family: Verdana; font-size: 12px;"> - главное меню магазина&nbsp;</span><br style="color: rgb(75, 75, 75); font-family: Verdana; font-size: 12px; background-color: rgb(231, 231, 231);" />\n<span style="color:#0000FF;"><span style="font-family: Verdana; font-size: 12px;">sm_inv, sm_inventory</span></span><span style="color: rgb(75, 75, 75); font-family: Verdana; font-size: 12px;"> - открытие инвентаря</span></p>\n\n<p><strong>Админ ROOT</strong></p>\n\n<p><span style="font-family: Verdana; font-size: 12px;"><span style="color:#0000FF;">sm_givecredits</span> &lt;ник&gt; &lt;кол-во кредитов&gt; - дать игроку кредиты&nbsp;</span><br style="color: rgb(75, 75, 75); font-family: Verdana; font-size: 12px; background-color: rgb(231, 231, 231);" />\n<span style="font-family: Verdana; font-size: 12px;"><span style="color:#0000FF;">sm_takecredits</span> &lt;ник&gt; &lt;кол-во кредитов&gt; - забрать N количество кредитов&nbsp;</span><br style="color: rgb(75, 75, 75); font-family: Verdana; font-size: 12px; background-color: rgb(231, 231, 231);" />\n<span style="font-family: Verdana; font-size: 12px;"><span style="color:#0000FF;">sm_setcredits</span> &lt;ник&gt; &lt;кол-во кредитов&gt; - установка кредитов игроку</span></p>\n\n<p><span style="font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px; text-align: -webkit-center;">Серверная команда&nbsp;</span><span style="color:#0000FF;"><b style="color: rgb(40, 40, 40); font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px; text-align: -webkit-center; background-color: rgb(230, 230, 230);"><span style="background-color:#FFFFFF;">shop_reload_settings</span></b></span><span style="font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px; text-align: -webkit-center;">&nbsp;для перезагрузки настроек</span></p>\n', 'csgo/', 1),
(271, 47, 'SM Super Menu v.0.5 + Super Commands 0.6', '<p>Плагины значительно расширяют дминку CSGO, добавляя в неё множество интересных функций, в основном для развлечения.</p>', 'csgo/', 5),
(274, 47, 'CSGO ESP/WH for Admins (Cheater Buster Tools)', '<p><span style="font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px;">Данный плагин очень похож на ESP для Админов который есть для версии CS 1.6 , на то он и называется ESP/WH for Admins , теперь вам не придется сидеть долго и вычислять WH по голым стенкам , в помощь Вам плагин ESP Cheater Buster Tools.&nbsp;</span></p>\n\n<p><strong><span style="font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px;">Настройки:</span></strong></p>\n\n<p><span style="font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px;"><span style="color:#0000FF;">sm_csgo_adminesp</span> &lt;1/0&gt; включить/выключить плагин</span></p>', 'csgo/', 4),
(273, 48, 'SDKHooks v2.2.0', 'Расширение SourceMod - требуется для работы некоторых плагинов', 'csgo/', 7),
(275, 41, 'KillMessages v2.4', 'Новая версия плагина KillMessages v2.4 пофикшеная , на sourcemod в стиле CombatArms при серии убийств выскакивает оверлейное сообщение в на фоне крове , очень красиво смотрится , думаю вам понравиться данная версия этого плагина для csgo, так же автор не собирается на этом заканчивать , так что ждем ещё новее версию. ', 'csgo/', 4),
(277, 47, 'Weapon Menu [оружейка для админа]', '<p><span style="font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px;">Это всем известный плагин из cs 1.6 , разработчики сделали и для csgo , в данном меню есть абсолютно всё , начиная от пистолетов заканчивая тяжёлым оружием , доступ к меню имеют Админы с флагом D (бан) , что-бы открыть меню оружейки достаточно написать в игровой чат <span style="color:#0000FF;">!weaponmenu</span> или же в консоле <span style="color:#0000FF;">sm_weaponmenu!</span></span></p>', 'csgo/addons/sourcemod/', 3),
(279, 46, 'RoundEndSound v2.5.0 (Beta 8)', 'Плагин [CS:GO] RoundEndSound с помощью которого на вашем сервере csgo в конце раунда будет играть нарезка музыки состоящая из 73 треков , рандомно в конце раунда разные треки.', 'csgo/', 7),
(280, 8, 'Effects plug-in', 'Плагин содержит подсчет убийств + убийств в голову, музыка в конце раунда, цветной экран при смерти + звук смеха. ', 'cstrike/', 7),
(282, 28, 'Resetscore', 'Отличный плагин для обнуление счёта на сервере.', 'cstrike/', 18),
(284, 28, 'Parachute', 'Позволяет открыть парашют на сервере,нажав кнопку Е', 'cstrike/', 14),
(285, 16, 'Resetscore', 'Отличный плагин для обнуление счёта на сервере.', 'cstrike/', 7),
(289, 28, 'SprayrTrace (SourceMod)', 'Данный материал предоставлен исключительно в ознакомительных целях', 'cstrike/', 10),
(290, 28, 'Заложники', 'Заложники из CS:GO для сервера', 'cstrike/', 3),
(291, 28, 'KnockBackScr', 'Простой плагин. Который отбрасывает при выстрелах.', 'cstrike/', 2),
(292, 32, 'Admin List v1.2 Rus', 'Если прописать в чате !admins,то в отдельном окне будут отображаться список админов онлайн.', 'cstrike/', 14),
(294, 28, 'QuickDefuse v0.3 Rus', 'Данный плагин облегчает задачу CT.\r\nCT могут дернуть провод у бомбы для более быстрой разминирования,\r\nесли он конечно же угадает провод.', 'cstrike/', 5),
(295, 31, 'Blocker_Passes', 'Плагин позволяет администратору сервера через админ меню устанавливать в нужных местах блокирующие проход пропсы или любые другие пропсы и включить автоматическую установку этих пропсов каждый раунд, если игроков на сервере меньше, чем указано к конфиге плагина.', 'cstrike/', 4),
(296, 2, 'AntiCheat GasPuff', 'Не дает играть на сервере, если у игрока измененный файл дыма. Или если игрок удалил этот файл, то он будет успешно закачан ему в CS1.6\r\n\r\nЧитерских уловок много, этот плагин закрывает лишь одну.', 'cstrike/', 5),
(335, 15, 'SourceMod 1.7.3', 'это аддон для MetaMod:Source, который в свою очередь является прослойкой между Source Engine и плагинами. Другими словами, он даёт нам возможность модифицировать игру по нашему желанию с помощью простейших действий - как использования функций самого SourceMod, так и устанавливая плагины.', 'cstrike/', 61),
(338, 37, 'Es Tools v.420', 'Плагин нужен для корректной работы скриптов всех Eventscripts', 'cstrike/', 10),
(339, 25, 'es_tools', 'Плагин нужен для коректной работы скриптов всех Eventscripts', 'cstrike/', 0),
(342, 30, 'GunGame', '<p><span style="color:#FFF0F5;">Source Gun Game - это мод, в котором игроки постепенно поднимаются по уровням игры. Вы начинаете с глока. Чтобы получить второй уровень вам необходимо убить из глока врага. И так далее, до конца. Самые сложные уровни - естественно последние, в наличие только граната и нож соответственно.<br />\nВсе это призвано помочь игрокам тренировать стрельбу из различного оружия.</span></p>\n\n<p><br />\n<span style="color:#FFF0F5;">Команды:</span></p>\n\n<p><span style="color:#FFF0F5;">sm_gungamesm_version - версия Gungame<br />\ngungame_enabled - отображает статус gungame (включен или выключен)</span></p>\n\n<p><span style="color:#FFF0F5;">gg_version - отображает информацию о версии gungame<br />\ngg_status - отображает статус текущей игры<br />\ngg_restart - сделает рестарт, игра начнется сначала<br />\ngg_enable - включит gungame и сделает рестарт<br />\ngg_disable - выключит gungame и сделает рестарт<br />\ngg_rebuild - перестроит статистику top10 в данных о игроках<br />\ngg_import - импортирует победителей в файл es es gungame3. Файл должен находится в папке data/gungame/es_gg_winners_db.txt.<br />\nЕсли вы хотите конвертировать базу данных с победителями из файла формата es gungame5 в gungame3 - используйте скрипт (нужен компилятор Python) tools/convert_winners_esgg_5to3.py.<br />\ngg_reset - сбросить всю gungame статистику. (только если sql статистика включена)<br />\ngg_importdb - импортировать победителей из файла gungame data в базу данных (только если sql статистика включена)</span></p>\n\n<p><span style="color:#FFF0F5;">Команды:<br />\nsay !level - показывает ваш текущий уровень, и кто выигрывает в данный момент<br />\nsay !weapons - показывает порядок оружия<br />\nsay !score - показывает текущий счет всех игроков<br />\nsay !top - показать лучших победителей на сервере<br />\nsay !rules - отображает правила игры<br />\nsay !leader - показать текущих лидеров<br />\nsay !rank - показать вашу текущую позицию в статистике. (только если sql статистика включена)</span></p>\n', 'cstrike/', 2),
(343, 18, 'GunGame', '<p><span style="color:#FFF0F5;">Source Gun Game - это мод, в котором игроки постепенно поднимаются по уровням игры. Вы начинаете с глока. Чтобы получить второй уровень вам необходимо убить из глока врага. И так далее, до конца. Самые сложные уровни - естественно последние, в наличие только граната и нож соответственно.<br />\nВсе это призвано помочь игрокам тренировать стрельбу из различного оружия.</span></p>\n\n<p><br />\n<span style="color:#FFF0F5;">Команды:</span></p>\n\n<p><span style="color:#FFF0F5;">sm_gungamesm_version - версия Gungame<br />\ngungame_enabled - отображает статус gungame (включен или выключен)</span></p>\n\n<p><span style="color:#FFF0F5;">gg_version - отображает информацию о версии gungame<br />\ngg_status - отображает статус текущей игры<br />\ngg_restart - сделает рестарт, игра начнется сначала<br />\ngg_enable - включит gungame и сделает рестарт<br />\ngg_disable - выключит gungame и сделает рестарт<br />\ngg_rebuild - перестроит статистику top10 в данных о игроках<br />\ngg_import - импортирует победителей в файл es es gungame3. Файл должен находится в папке data/gungame/es_gg_winners_db.txt.<br />\nЕсли вы хотите конвертировать базу данных с победителями из файла формата es gungame5 в gungame3 - используйте скрипт (нужен компилятор Python) tools/convert_winners_esgg_5to3.py.<br />\ngg_reset - сбросить всю gungame статистику. (только если sql статистика включена)<br />\ngg_importdb - импортировать победителей из файла gungame data в базу данных (только если sql статистика включена)</span></p>\n\n<p><span style="color:#FFF0F5;">Команды:<br />\nsay !level - показывает ваш текущий уровень, и кто выигрывает в данный момент<br />\nsay !weapons - показывает порядок оружия<br />\nsay !score - показывает текущий счет всех игроков<br />\nsay !top - показать лучших победителей на сервере<br />\nsay !rules - отображает правила игры<br />\nsay !leader - показать текущих лидеров<br />\nsay !rank - показать вашу текущую позицию в статистике. (только если sql статистика включена)</span></p>\n', 'cstrike/', 0),
(344, 30, 'RPG мод', 'RPG mod', 'cstrike/', 1);
INSERT INTO `gh_addons` (`id`, `cat`, `name`, `info`, `dir`, `install`) VALUES
(348, 30, 'Jail Mod', '<p><span style="color:#FFF0F5;">Смысл это игры в том, что террористы сидят изначально в тюрьме за решетками! Спецназ открывают решетки и выпускают Террористов... у всех изначально оружие ножи... но у Спецназа рядом арсенал оружия... в общем система как в тюрьме над зеками.<br />\nЗадача Террориста - на одних картах сбежать,на других поставить бомбу и взорвать её... ну или убить всех охранников...<br />\nЗадачи Контр-террористов - продержаться до конца раунда: либо не дать выжить террористам, либо не дать взорвать бомбу... Но безпричинная стрельба по террористу это неправильно.<br />\njailmod_on (defualt 1): 1 вкл, выкл плагина&nbsp;<br />\njailmod_eyes (defualt 1): если 0 то игроки могут летать сквозь стены и искать тайные места&nbsp;</span></p>\n', 'cstrike/', 2),
(349, 9, 'Прозрачные гранаты!', '<p>Отлично прорисованные модели прозрачных гранат. Вам хотелось бы иметь не много не стандартную модель тогда &quot;Отлично прорисованные модели прозрачных гранат&quot; Хорошо подойдут. Ведь они действительно прозрачные! как видно на скриншоте.</p>\r\n\r\n<p style="text-align: center;"><img alt="" src="http://cscontrol.ru/_ld/58/96358131.png" style="width: 163px; height: 187px; float: left;" /></p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'cstrike/', 3),
(351, 10, 'Revive Teammate', '<p><span style="font-family: Tahoma, Helvetica, sans-serif; font-size: 12px; font-weight: bold; line-height: 22px;">Revive Teammate</span><span style="font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px;">&nbsp;- плагин позволяющий воскресить товарища по команде в любой момент за определенную сумму денег. Возможно настроить работу плагина для определенной команды или же для обеих сразу , а так же позволить выдавать воскрешенному броню , оружие и гранаты.&nbsp;</span></p>\r\n\r\n<p><font face="Tahoma, Helvetica, sans-serif"><span style="font-size: 13.3333330154419px;"><b>Команда</b></span></font><br style="color: rgb(40, 40, 40); font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px; background-color: rgb(230, 230, 230);" />\r\n<span style="color:#0000CD;"><span style="font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px;"><b>/revtm</b></span></span><span style="font-family: Tahoma, Helvetica, sans-serif; font-size: 13.3333330154419px;">&nbsp;- меню со всеми мертвыми тимейтами для воскрешения.&nbsp;</span></p>', 'cstrike/', 2),
(355, 10, 'KnifeDrop', '<p>Knife Drop - плагин позволяющий выбрасывать нож , а так же его подбирать , в случае если в предыдущем раунде вы выкинули ножик и при респавне следующего раунда он появится в вашем снаряжение.</p>\r\n', 'cstrike/', 4),
(357, 10, 'Status Me', '<p>Status Me - простой плагин позволяющий узнать свой ip адрес , steamid и права доступа на сервере , все это красиво оформлено в цветном чате. Чат-команда: /status</p>\r\n', 'cstrike/', 5),
(362, 27, 'No Steam', 'Отключает верификацию Steam', '/cstrike', 0);
